import React from "react";
import './header.sass' 

const Header = () => {
   return (
      <header className="header">
         <img src="images/logo.svg" alt="" className="logo" />
         <nav className="menu"></nav>
         <img src="images/menu.svg" alt="" className="menu-" />
      </header>
   )
}
export default Header
